import React from 'react';

const Rank = ({name, entries}) => {
    return (
        <div>
            {`${name}, your current rank is...`}
            <div className="db dim moon-gray f3">
                {entries}
            </div>
            <div className="db dim moon-gray f1">
                {'#1'}
            </div>
        </div>
    )
}

export default Rank;
